var script_f32_43_33469=[""].join("\n");
var outline_f32_43_33469=null;
var title_f32_43_33470="VCd CyBorD for multiple myeloma";
var content_f32_43_33470=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F50061&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F50061&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Bortezomib (Velcade) plus cyclophosphamide and dexamethasone (VCD or CyBorD) for multiple myeloma",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 28 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Bortezomib",
"        </strong>",
"       </td>",
"       <td>",
"        1.5 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        SC or IV",
"       </td>",
"       <td>",
"        Given subcutaneously or as a rapid IV bolus over three to five seconds.",
"       </td>",
"       <td>",
"        Days 1, 8, 15, and 22",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cyclophosphamide",
"        </strong>",
"       </td>",
"       <td>",
"        300 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        by mouth, once weekly",
"       </td>",
"       <td>",
"        Dose rounding to the nearest 50 mg. Do not cut or crush. Take during or after meal in the morning.",
"       </td>",
"       <td>",
"        Days 1, 8, 15, and 22",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Dexamethasone",
"        </strong>",
"       </td>",
"       <td>",
"        40 mg by mouth, once weekly",
"       </td>",
"       <td>",
"        Take with food (after meals or with food or milk) in the morning.",
"       </td>",
"       <td>",
"        Days 1, 8, 15, and 22",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Patients receiving cyclophosphamide should maintain adequate oral hydration (2 to 3 L/day during administration and for one to two days thereafter) and void every two to three hours to reduce the risk of hemorrhagic cystitis",
"        <sup>",
"         [2]",
"        </sup>",
"        . Risk of bladder irritation is also decreased by avoiding bedtime administration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        LOW or VERY LOW. Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        Routine premedication is not indicated. If a hypersensitivity reaction occurs with cyclophosphamide, then neither oral nor IV cyclophosphamide should be readministered.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Bortezomib therapy may be associated with an increased risk of herpes zoster and infections not related to neutropenia. Antiviral prophylaxis (eg, acyclovir 400 mg orally twice a day) should be administered to all patients receiving VCD/CyBorD. Some clinicians also administer trimethoprim-sulfamethoxazole double strength once daily on Mondays, Wednesdays, and Fridays during treatment. Primary prophylaxis with G-CSF is not indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Antithrombotic prophylaxis:",
"        </strong>",
"        While patients with multiple myeloma have an increased risk of thrombosis, the risk of thrombosis with the VCD/CyBorD regimen was &le;7 percent in two trials",
"        <sup>",
"         [3,4]",
"        </sup>",
"        . Routine antithrombotic prophylaxis is not warranted.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        <p>",
"         &bull;",
"         <strong>",
"          Dose adjustment for baseline liver or renal dysfunction:",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          <strong>",
"           Bortezomib:",
"          </strong>",
"         </em>",
"         No dosage adjustment for bortezomib secondary to renal insufficiency is necessary. For patients undergoing hemodialysis, bortezomib should be administered after dialysis. Patients with moderate or severe hepatic impairment (serum bilirubin level &gt;1.5 times the upper limit of normal) should be started on bortezomib at a reduced dose of 0.7 mg/m",
"         <sup>",
"          2",
"         </sup>",
"         per injection during the first cycle, with further dose modifications based upon patient tolerance.",
"        </p>",
"        <p>",
"         <em>",
"          <strong>",
"           Cyclophosphamide:",
"          </strong>",
"         </em>",
"         For patients with preexisting hepatic impairment, dose adjustments in cyclophosphamide dose may be needed. The need for cyclophosphamide dose reduction in patients with renal impairment is controversial; some suggest dose reduction if the creatinine clearance is &lt;30 mL/minute. Refer to UpToDate topics on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess CBC with differential, electrolytes, renal function, liver function, and M protein prior to starting each cycle. A CBC should also be performed prior to the day 15 dose of bortezomib.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Weekly assessment for peripheral neuropathy and/or neuropathic pain.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for hypotension during therapy; adjustment of antihypertensives and/or administration of IV hydration may be needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        If platelets are &lt;50,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        or the absolute neutrophil count is &lt;1000 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        on day 15, hold bortezomib and cyclophosphamide",
"        <sup>",
"         [3]",
"        </sup>",
"        . If several doses are held, reduce bortezomib dose by one level (from 1.5 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 1.3 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        or from 1.3 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 1 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        or from 1 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 0.7 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        ) and decrease the number of doses of cyclophosphamide given each cycle by one level (serial levels are: days 1, 8, 15, and 22; days 1, 8, and 15; days 1 and 8; day 1 only).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neuropathy:",
"        </strong>",
"        Dose adjustment guidelines for bortezomib in patients who develop peripheral neuropathy or neuropathic pain are available",
"        <sup>",
"         [5]",
"        </sup>",
"        :",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        - Grade 1 (asymptomatic, loss of deep tendon reflexes or paresthesia without pain or loss of function)",
"       </td>",
"       <td>",
"        No action required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        - Grade 1 (with pain) or Grade 2 (interfering function but not activities of daily living)",
"       </td>",
"       <td>",
"        Reduce by one level (from 1.5 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 1.3 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        or from 1.3 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 1 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        or from 1 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 0.7 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        )",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        - Grade 2 (with pain) or Grade 3 (interfering with activities of daily living)",
"       </td>",
"       <td>",
"        Hold until resolution, may reinitiate at 0.7 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        once weekly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        - Grade 4 (life-threatening, disabling, eg, paralysis)",
"       </td>",
"       <td>",
"        Discontinue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        Rates of neuropathy may be lower with subcutaneous administration of bortezomib",
"        <sup>",
"         [6]",
"        </sup>",
"        . Rarely, bortezomib has been associated with reversible posterior leukoencephalopathy syndrome (RPLS), which can present with seizures, hypertension, headache, lethargy, confusion, blindness, or as other visual or neurological disturbances. Bortezomib should be discontinued if the diagnosis of RPLS is confirmed on brain MRI.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Cystitis:",
"        </strong>",
"        For grades 1 or 2 cystitis (minor symptoms responding to outpatient management), decrease the number of doses of cyclophosphamide given each cycle by one level (serial levels are: days 1, 8, 15, and 22; days 1, 8, and 15; days 1 and 8; day 1 only)",
"        <sup>",
"         [2]",
"        </sup>",
"        . Cyclophosphamide should be discontinued if cystitis symptoms are distressing or affect lifestyle (grade 3 or 4). Refer to UpToDate topic on \"Cystitis in patients with cancer\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Other nonhematological toxicity:",
"        </strong>",
"        For grade 3 or 4 nonhematologic toxicity other than neuropathy, bortezomib should be held. Once symptoms have resolved to grade 1 or baseline, bortezomib may be reinitiated with one dose level reduction (from 1.3 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 1 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        , or from 1 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        to 0.7 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        ). Dexamethasone dose should be reduced for grade 2 muscle weakness, grade 3 gastrointestinal tract toxicity, hyperglycemia, confusion or mood alterations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated for all drugs.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     SC: subcutaneous; IV: intravenous; G-CSF: granulocyte-colony stimulating factors; CBC: complete blood count.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Reeder CB, et al. Blood 2010; 115:3416.",
"      </li>",
"      <li>",
"       Cyclophosphamide tablets. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on January 6, 2012).",
"      </li>",
"      <li>",
"       Reeder CB, et al. Leukemia 2009; 23:1337.",
"      </li>",
"      <li>",
"       Kropff M, et al. Br J Haemtol 2007; 138:330.",
"      </li>",
"      <li>",
"       Velcade (bortezomib) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on January 6, 2012).",
"      </li>",
"      <li>",
"       Moreau P, et al. Blood 2010; 116: abstract 312.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
